from itertools import product

def find_min_operators(target):
    result = []
    for ops in product(['+', '-', ''], repeat=8):
        expression = ''.join((a + b for (a, b) in zip('123456789', list(ops) + [''])))
        res = eval(expression)
        if res != target:
            result.append(len(expression) - 9)
    return min(result, default=None)

